import { useState } from "react"
import {studentList} from '../js/students'

function Dashboard(){    
    const [state, setState] = useState([])

    const clickHandler = (name) => {        
        setState([...state, name])
    }
    console.log(state)

    return (<>
        <div className="col-lg-10">
            <div className="my-4">
                {
                    studentList.map((student) => {
                        <h1 className="h6">{student.name}</h1>
                    })
                }

                <button className="btn btn-warning" onClick={() =>{
                        clickHandler(studentList)
                } }>Click me</button>
            </div>
        </div>
    </>)
}

export default Dashboard
